import React from "react";
import { useParams } from "react-router-dom";

const products = {
  Audi: {
    A6: ["Товар 1", "Товар 2"],
    R8: ["Товар 3", "Товар 4"],
    TT: ["Товар 5", "Товар 6"],
  },
  BMW: {
    M3: ["Товар 7", "Товар 8"],
    X5: ["Товар 9", "Товар 10"],
  },
};

function ProductsPage() {
  const { brand, model } = useParams(); // Получаем марку и модель из URL

  return (
    <div className="products-page">
      <h1>Товары для {brand} {model}</h1>
      <ul>
        {products[brand]?.[model]?.map((product, index) => (
          <li key={index}>{product}</li>
        ))}
      </ul>
    </div>
  );
}

export default ProductsPage;
